PARENTS (1989)

Runtime: 81 minutes
Rating: 6.1 @ http://imdb.com/title/tt0098068/
Genre: Horror/Comedy

Michael Laemie is a young boy living in a typical 1950s suburbanite home... except for his bizarre and horrific nightmares, and continued unease around his parents. Especially his father, Nick Laemie (played by Randy Quaid). Young Michael begins to suspect his parents are cooking more than just hamburgers on the grill outside, but has trouble explaining his fears to his newfound friend Sheila, or the school's social worker.
